import React, { useState, useEffect } from "react";
import { Container, Row, Col,Form } from "react-bootstrap";
import { useHistory } from "react-router-dom";
import Header from "../component/header";
import "./Category.scss";
import CardCategory from "../component/CardCategory";
const Form1 = () => {
  return (
    <div className="container">
      <Container fluid>
        <Row>
          <Header />
        </Row>
        <Row>
            <h1>Enter Product Detail</h1>

        <Form>
  <Form.Group controlId="exampleForm.ControlInput1">
    <Form.Label>Product Name</Form.Label>
    <Form.Control type="input" placeholder="Enter the product name here" />
  </Form.Group>
  <Form.Group controlId="exampleForm.ControlInput1">
    <Form.Label>Brand</Form.Label>
    <Form.Control type="input" placeholder="Enter the brand name here" />
  </Form.Group>
  <Form.Group controlId="exampleForm.ControlInput1">
    <Form.Label>How old?</Form.Label>
    <Form.Control type="input" placeholder="How old the product is?" />
  </Form.Group>
  <Form.Group controlId="exampleForm.ControlInput1">
    <Form.Label>Description</Form.Label>
    <Form.Control type="input" placeholder="Write the description about the product" />
  </Form.Group>
</Form> 
        </Row>
      </Container>
    </div>
  );
};

export default Form1;
